export interface Progress {
    /**
     * debug级别
     * @param log
     */
    debug(log: string): void;
    /**
     * info级别
     * @param log
     */
    info(log: string): void;
    /**
     * warn级别
     * @param log
     */
    warn(log: string): void;
    /**
     * error级别
     * @param log
     */
    error(log: string): void;
    /**
     * fatal级别
     * @param log
     */
    fatal(log: string): void;
}
